import React, { Component } from "react";
import Navbar from "./components/layout/Navbar.js";
import "./App.css";
import UserItem from "./components/users/UserItem.js";
class App extends Component {
  render() {
    return (
      <div className="navbar bg-primary">
        <Navbar />
        <UserItem />
      </div>
    );
  }
}

export default App;
